import React from 'react';
//import { * } from './HeaderComponents'

const Header = () => {
  return (
    <HeaderWrapper>
      <HeaderContainer>
        <CompanyName>WISELY</CompanyName>
        <ItemContainer>
          <Item to="#">제품보기</Item>
          <Item to="#">브랜드 스토리</Item>
          <Item to="#">블로그</Item>
          <Item to="#">고객센터</Item>
        </ItemContainer>
      </HeaderContainer>
    </HeaderWrapper>
  );
}

export default Header;
